import{_ as s,c as a,o as e,a as n}from"./app.0b159a37.js";const g=JSON.parse('{"title":"隐式转换的笔记","description":"","frontmatter":{"title":"隐式转换的笔记","tags":["隐式转换"],"创建时间":"星期三, 十二月 21日 2022, 11:49:18 晚上","修改时间":"星期四, 十二月 22日 2022, 9:57:50 晚上"},"headers":[{"level":2,"title":"1. 对象和布尔值比较","slug":"_1-对象和布尔值比较","link":"#_1-对象和布尔值比较","children":[]},{"level":2,"title":"2. 对象和字符串比较","slug":"_2-对象和字符串比较","link":"#_2-对象和字符串比较","children":[]},{"level":2,"title":"3. 对象和数字比较","slug":"_3-对象和数字比较","link":"#_3-对象和数字比较","children":[]},{"level":2,"title":"4. 字符串和数字比较","slug":"_4-字符串和数字比较","link":"#_4-字符串和数字比较","children":[]},{"level":2,"title":"5. 字符串和布尔值比较","slug":"_5-字符串和布尔值比较","link":"#_5-字符串和布尔值比较","children":[]},{"level":2,"title":"6. 布尔值和数字比较","slug":"_6-布尔值和数字比较","link":"#_6-布尔值和数字比较","children":[{"level":3,"title":"布尔值和数字进行比较时，布尔转换为数字，二者比较。","slug":"布尔值和数字进行比较时-布尔转换为数字-二者比较。","link":"#布尔值和数字进行比较时-布尔转换为数字-二者比较。","children":[]},{"level":3,"title":"还有一些需要记住的，像：","slug":"还有一些需要记住的-像","link":"#还有一些需要记住的-像","children":[]}]},{"level":2,"title":"参考链接","slug":"参考链接","link":"#参考链接","children":[]}],"relativePath":"工作区/基本知识/JavaScript/隐式转换.md"}'),l={name:"工作区/基本知识/JavaScript/隐式转换.md"},t=n(`<p>#隐式转换</p><h1 id="隐式转换的笔记" tabindex="-1">隐式转换的笔记 <a class="header-anchor" href="#隐式转换的笔记" aria-hidden="true">#</a></h1><blockquote><p>JavaScript中的不同的数据类型之间的比较转换规则如下：</p></blockquote><h2 id="_1-对象和布尔值比较" tabindex="-1">1. 对象和布尔值比较 <a class="header-anchor" href="#_1-对象和布尔值比较" aria-hidden="true">#</a></h2><p>对象和布尔值进行比较时，对象先转换为字符串，然后再转换为数字，布尔值直接转换为数字🔗🔗</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[] == true;  //false  []转换为字符串&#39;&#39;,然后转换为数字0,true转换为数字1，所以为false </span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h2 id="_2-对象和字符串比较" tabindex="-1">2. 对象和字符串比较 <a class="header-anchor" href="#_2-对象和字符串比较" aria-hidden="true">#</a></h2><p>对象和字符串进行比较时，对象转换为字符串，然后两者进行比较。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[1,2,3] == &#39;1,2,3&#39; // true  [1,2,3]转化为&#39;1,2,3&#39;，然后和&#39;1,2,3&#39;， so结果为true; </span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h2 id="_3-对象和数字比较" tabindex="-1">3. 对象和数字比较 <a class="header-anchor" href="#_3-对象和数字比较" aria-hidden="true">#</a></h2><p>对象和数字进行比较时，对象先转换为字符串，然后转换为数字，再和数字进行比较。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[1] == 1;  // true  \`对象先转换为字符串再转换为数字，二者再比较 [1] =&gt; &#39;1&#39; =&gt; 1 所以结果为true </span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h2 id="_4-字符串和数字比较" tabindex="-1">4. 字符串和数字比较 <a class="header-anchor" href="#_4-字符串和数字比较" aria-hidden="true">#</a></h2><p>字符串和数字进行比较时，字符串转换成数字，二者再比较。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">&#39;1&#39; == 1 // true </span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h2 id="_5-字符串和布尔值比较" tabindex="-1">5. 字符串和布尔值比较 <a class="header-anchor" href="#_5-字符串和布尔值比较" aria-hidden="true">#</a></h2><p>字符串和布尔值进行比较时，二者全部转换成数值再比较。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">&#39;1&#39; == true; // true </span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h2 id="_6-布尔值和数字比较" tabindex="-1">6. 布尔值和数字比较 <a class="header-anchor" href="#_6-布尔值和数字比较" aria-hidden="true">#</a></h2><h3 id="布尔值和数字进行比较时-布尔转换为数字-二者比较。" tabindex="-1">布尔值和数字进行比较时，布尔转换为数字，二者比较。 <a class="header-anchor" href="#布尔值和数字进行比较时-布尔转换为数字-二者比较。" aria-hidden="true">#</a></h3><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">true == 1 // true </span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><p>许多刚接触js的童鞋看到这么多的转换规则就懵圈了，其实规律很简单，大家可以记下边这个图(是时候展现我高超的绘画技巧了)</p><p><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202212221148639.png" alt=""></p><p>如图，任意两种类型比较时，如果不是同一个类型比较的话，则按如图方式进行相应类型转换，如对象和布尔比较的话，对象 =&gt; 字符串 =&gt; 数值 布尔值 =&gt; 数值。 另外，我们来看下一些需要&quot;特别照顾&quot;的。</p><p>来看一个有趣的题</p><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[] </span><span style="color:#89DDFF;">==</span><span style="color:#A6ACCD;"> </span><span style="color:#FF9CAC;">false</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#89DDFF;">!</span><span style="color:#A6ACCD;">[] </span><span style="color:#89DDFF;">==</span><span style="color:#A6ACCD;"> </span><span style="color:#FF9CAC;">false</span><span style="color:#89DDFF;">;</span><span style="color:#A6ACCD;"> </span></span>
<span class="line"></span></code></pre></div><p>这两个的结果都是true,第一个是，对象 =&gt; 字符串 =&gt; 数值0 false转换为数字0,这个是true应该没问题， 第二个前边多了个!，则直接转换为布尔值再取反，转换为布尔值时，<code>空字符串(&#39;&#39;),NaN,0，null,undefined</code>这几个外返回的都是true, 所以! []这个[] =&gt; true 取反为false,所以![] == false为true。</p><h3 id="还有一些需要记住的-像" tabindex="-1">还有一些需要记住的，像： <a class="header-anchor" href="#还有一些需要记住的-像" aria-hidden="true">#</a></h3><div class="language-js"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki"><code><span class="line"><span style="color:#89DDFF;">undefined</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">==</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">null</span><span style="color:#A6ACCD;"> </span><span style="color:#676E95;">//true undefined和null 比较返回true，二者和其他值比较返回false</span></span>
<span class="line"><span style="color:#82AAFF;">Number</span><span style="color:#A6ACCD;">(</span><span style="color:#89DDFF;">null</span><span style="color:#A6ACCD;">) </span><span style="color:#676E95;">//0 </span></span>
<span class="line"></span></code></pre></div><h2 id="参考链接" tabindex="-1">参考链接 <a class="header-anchor" href="#参考链接" aria-hidden="true">#</a></h2><ul><li>[Js中的隐式转换](<a href="https://www.cnblogs.com/chenmeng0818/p/5954215.html" target="_blank" rel="noreferrer">https://www.cnblogs.com/chenmeng0818/p/5954215.html</a> &quot;<a href="https://www.cnblogs.com/chenmeng0818/p/5954215.html" target="_blank" rel="noreferrer">https://www.cnblogs.com/chenmeng0818/p/5954215.html</a> )</li><li><a href="https://www.freecodecamp.org/chinese/news/javascript-implicit-type-conversion/" target="_blank" rel="noreferrer">JavaScript隐式转换⭐️⭐️</a></li></ul>`,31),p=[t];function o(c,r,i,d,h,u){return e(),a("div",null,p)}const _=s(l,[["render",o]]);export{g as __pageData,_ as default};
